import React, { Component } from "react";
import axios from 'axios';
import Navbar from "./Navbar";

class Add extends Component {
  constructor(props) {
    super(props);

    this.state = {
      title: "",
      city: "",
      location: "",
      price: "",
      bedroom: "",
      bathroom: "",
      area: "",
    };
  }
  handletitleChange = (event) => {
    this.setState({
      title: event.target.value,
    });
  };
  handlecityChange = (event) => {
    this.setState({
      city: event.target.value,
    });
  };

  handlelocatioChange = (event) => {
    this.setState({
      location: event.target.value,
    });
  };

  handlepriceChange = (event) => {
    this.setState({
      price: event.target.value,
    });
  };


  handlebedroomChange = (event) => {
    this.setState({
      bedroom: event.target.value,
    });
  };
  handlebathroomChange = (event) => {
    this.setState({
      bathroom: event.target.value,
    });
  };
  handleareaChange = (event) => {
    this.setState({
      area: event.target.value,
    });
  };

  handleSubmit = (event) => {
    alert(
      "${this.state.title} ${this.state.city} ${this.state.location} ${this.state.price}  ${this.state.bedroom} ${this.state.bathroom} ${this.state.area}"
    );
    event.preventDefault();

    const propInfo = {
        title: this.state.title,
        city: this.state.city,
        location: this.state.location,
        price: this.state.price,
        bedroom: this.state.bedroom,
        bathroom: this.state.bathroom,
        area: this.state.area,
      }
  
      axios.post('http://localhost:4000/add', propInfo)
              .then((res) => {
                  console.log(res.data)
              }).catch((error) => {
                  console.log(error)
              });

  };

  render() {
    return (
      <div className="container">
        <div className="agentlogin">
          <h3> Add the details </h3>{" "}
          <form onSubmit={this.handleSubmit}>
            <div className="wrapper">
              <div>
                <label> Title </label>{" "}
                <input
                  type="text"
                  vlaue={this.state.title}
                  onChange={this.handletitle}
                />
              </div>{" "}
              <div>
                <label> City </label>{" "}
                <input
                  type="text"
                  vlaue={this.state.city}
                  onChange={this.handlecity}
                />
              </div>{" "}
              <div>
                <label> Location </label>{" "}
                <input
                  type="text"
                  vlaue={this.state.location}
                  onChange={this.handlelocation}
                />
              </div>{" "}
              <div>
                <label> Price </label>{" "}
                <input
                  type="number"
                  vlaue={this.state.price}
                  onChange={this.handleprice}
                />{" "}
              </div>{" "}
              <div>
                <label> Bedroom </label>{" "}
                <input
                  type="number"
                  vlaue={this.state.bedroom}
                  onChange={this.handlebedroom}
                />{" "}
              </div>{" "}
              <div>
                <label> Bathroom </label>{" "}
                <input
                  type="number"
                  vlaue={this.state.bathroom}
                  onChange={this.handlebathroom}
                />{" "}
              </div>{" "}
              <div>
                <label> Area </label>{" "}
                <input
                  type="text"
                  vlaue={this.state.area}
                  onChange={this.handlearea}
                />{" "}
              </div>{" "}
              <button type="submit"> Submit </button>{" "}
            </div>{" "}
          </form>
        </div>{" "}
      </div>
    );
  }
}

export default Add;
